BEGIN;
SET CONSTRAINTS ALL DEFERRED;

CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY , "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY , "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY , "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY , "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY , "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "levels" ("id" integer NOT NULL PRIMARY KEY , "level_name" varchar(50) NOT NULL UNIQUE, "level_number" integer unsigned NOT NULL UNIQUE CHECK ("level_number" >= 0), "description" text NULL);
CREATE TABLE IF NOT EXISTS "majors" ("id" integer NOT NULL PRIMARY KEY , "major_name" varchar(100) NOT NULL UNIQUE, "description" text NULL, "is_active" bool NOT NULL, "created_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "semesters" ("id" integer NOT NULL PRIMARY KEY , "name" varchar(100) NOT NULL UNIQUE, "academic_year" varchar(20) NOT NULL, "semester_number" integer unsigned NOT NULL CHECK ("semester_number" >= 0), "start_date" date NOT NULL, "end_date" date NOT NULL, "is_current" bool NOT NULL, "created_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "users" ("id" integer NOT NULL PRIMARY KEY , "password" varchar(128) NOT NULL, "is_superuser" bool NOT NULL, "academic_id" varchar(50) NOT NULL UNIQUE, "id_card_number" varchar(50) NOT NULL UNIQUE, "full_name" varchar(150) NOT NULL, "email" varchar(254) NULL UNIQUE, "account_status" varchar(20) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "last_login" datetime NULL, "profile_picture" varchar(100) NULL, "phone_number" varchar(20) NULL, "level_id" bigint NULL REFERENCES "levels" ("id") DEFERRABLE INITIALLY DEFERRED, "major_id" bigint NULL REFERENCES "majors" ("id") DEFERRABLE INITIALLY DEFERRED, "role_id" bigint NULL REFERENCES "roles" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_groups" ("id" integer NOT NULL PRIMARY KEY , "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_user_permissions" ("id" integer NOT NULL PRIMARY KEY , "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "password_reset_tokens" ("id" integer NOT NULL PRIMARY KEY , "token" varchar(255) NOT NULL UNIQUE, "expires_at" datetime NOT NULL, "is_used" bool NOT NULL, "created_at" datetime NOT NULL, "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "role_permissions" ("id" integer NOT NULL PRIMARY KEY , "permission_id" bigint NOT NULL REFERENCES "permissions" ("id") DEFERRABLE INITIALLY DEFERRED, "role_id" bigint NOT NULL REFERENCES "roles" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "user_activity" ("id" integer NOT NULL PRIMARY KEY , "activity_type" varchar(50) NOT NULL, "description" text NULL, "ip_address" char(39) NULL, "user_agent" text NULL, "activity_time" datetime NOT NULL, "file_id" integer unsigned NULL CHECK ("file_id" >= 0), "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "verification_codes" ("id" integer NOT NULL PRIMARY KEY , "code" varchar(10) NOT NULL, "email" varchar(254) NOT NULL, "expires_at" datetime NOT NULL, "is_used" bool NOT NULL, "created_at" datetime NOT NULL, "attempts" integer unsigned NOT NULL CHECK ("attempts" >= 0), "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY , "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "courses" ("id" integer NOT NULL PRIMARY KEY , "course_name" varchar(150) NOT NULL, "course_code" varchar(20) NOT NULL UNIQUE, "description" text NULL, "credit_hours" integer unsigned NOT NULL CHECK ("credit_hours" >= 0), "is_active" bool NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "level_id" bigint NOT NULL REFERENCES "levels" ("id") DEFERRABLE INITIALLY DEFERRED, "semester_id" bigint NOT NULL REFERENCES "semesters" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "course_majors" ("id" integer NOT NULL PRIMARY KEY , "created_at" datetime NOT NULL, "course_id" bigint NOT NULL REFERENCES "courses" ("id") DEFERRABLE INITIALLY DEFERRED, "major_id" bigint NOT NULL REFERENCES "majors" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "instructor_courses" ("id" integer NOT NULL PRIMARY KEY , "assigned_date" date NOT NULL, "is_primary" bool NOT NULL, "course_id" bigint NOT NULL REFERENCES "courses" ("id") DEFERRABLE INITIALLY DEFERRED, "instructor_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "lectures_files" ("id" integer NOT NULL PRIMARY KEY , "title" varchar(255) NOT NULL, "description" text NULL, "content_type" varchar(20) NOT NULL, "local_file" varchar(100) NULL, "external_link" varchar(512) NULL, "file_type" varchar(50) NOT NULL, "file_size" bigint NULL, "file_extension" varchar(20) NULL, "mime_type" varchar(100) NULL, "upload_date" datetime NOT NULL, "updated_at" datetime NOT NULL, "is_visible" bool NOT NULL, "is_deleted" bool NOT NULL, "deleted_at" datetime NULL, "download_count" integer unsigned NOT NULL CHECK ("download_count" >= 0), "view_count" integer unsigned NOT NULL CHECK ("view_count" >= 0), "course_id" bigint NOT NULL REFERENCES "courses" ("id") DEFERRABLE INITIALLY DEFERRED, "uploader_id" bigint NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "ai_chats" ("id" integer NOT NULL PRIMARY KEY , "question" text NOT NULL, "answer" text NOT NULL, "is_helpful" bool NULL, "created_at" datetime NOT NULL, "response_time" real NOT NULL, "file_id" bigint NOT NULL REFERENCES "lectures_files" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "ai_usage_logs" ("id" integer NOT NULL PRIMARY KEY , "request_type" varchar(20) NOT NULL, "tokens_used" integer unsigned NOT NULL CHECK ("tokens_used" >= 0), "request_time" datetime NOT NULL, "was_cached" bool NOT NULL, "success" bool NOT NULL, "error_message" text NULL, "file_id" bigint NULL REFERENCES "lectures_files" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "api_key_used_id" bigint NULL REFERENCES "ai_api_keys" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "system_settings" ("id" integer NOT NULL PRIMARY KEY , "key" varchar(100) NOT NULL UNIQUE, "value" text NOT NULL, "description" text NULL, "is_public" bool NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "audit_logs" ("id" integer NOT NULL PRIMARY KEY , "action" varchar(20) NOT NULL, "model_name" varchar(100) NOT NULL, "object_id" integer unsigned NULL CHECK ("object_id" >= 0), "object_repr" varchar(255) NULL, "changes" text NULL CHECK ((JSON_VALID("changes") OR "changes" IS NULL)), "ip_address" char(39) NULL, "user_agent" text NULL, "timestamp" datetime NOT NULL, "user_id" bigint NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "roles" ("id" integer NOT NULL PRIMARY KEY , "description" text NULL, "created_at" datetime NOT NULL, "code" varchar(50) NOT NULL UNIQUE, "display_name" varchar(100) NOT NULL, "is_system" bool NOT NULL, "is_active" bool NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "permissions" ("id" integer NOT NULL PRIMARY KEY , "description" text NULL, "code" varchar(100) NOT NULL UNIQUE, "display_name" varchar(150) NOT NULL, "category" varchar(50) NOT NULL, "is_active" bool NOT NULL, "created_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "ai_generated_questions" ("id" integer NOT NULL PRIMARY KEY , "question_text" text NOT NULL, "question_type" varchar(50) NOT NULL, "options" text NULL CHECK ((JSON_VALID("options") OR "options" IS NULL)), "correct_answer" text NOT NULL, "explanation" text NULL, "difficulty_level" varchar(20) NOT NULL, "generated_at" datetime NOT NULL, "is_cached" bool NOT NULL, "file_id" bigint NOT NULL REFERENCES "lectures_files" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "score" real NOT NULL);
CREATE TABLE IF NOT EXISTS "ai_summaries" ("id" integer NOT NULL PRIMARY KEY , "language" varchar(10) NOT NULL, "word_count" integer unsigned NOT NULL CHECK ("word_count" >= 0), "generated_at" datetime NOT NULL, "generation_time" real NOT NULL, "model_used" varchar(100) NOT NULL, "is_cached" bool NOT NULL, "file_id" bigint NOT NULL UNIQUE REFERENCES "lectures_files" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "md_file_path" varchar(500) NULL, "summary_text" text NOT NULL);
CREATE TABLE IF NOT EXISTS "ai_generation_jobs" ("id" integer NOT NULL PRIMARY KEY , "job_type" varchar(20) NOT NULL, "config" text NOT NULL CHECK ((JSON_VALID("config") OR "config" IS NULL)), "user_notes" text NOT NULL, "md_file_path" varchar(500) NULL, "status" varchar(20) NOT NULL, "error_message" text NULL, "created_at" datetime NOT NULL, "completed_at" datetime NULL, "file_id" bigint NOT NULL REFERENCES "lectures_files" ("id") DEFERRABLE INITIALLY DEFERRED, "instructor_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "student_progress" ("id" integer NOT NULL PRIMARY KEY , "progress" integer unsigned NOT NULL CHECK ("progress" >= 0), "last_position" varchar(100) NOT NULL, "last_accessed" datetime NOT NULL, "total_time_seconds" integer unsigned NOT NULL CHECK ("total_time_seconds" >= 0), "file_id" bigint NOT NULL REFERENCES "lectures_files" ("id") DEFERRABLE INITIALLY DEFERRED, "student_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "notification_recipients" ("id" integer NOT NULL PRIMARY KEY , "is_read" bool NOT NULL, "read_at" datetime NULL, "is_deleted" bool NOT NULL, "notification_id" bigint NOT NULL REFERENCES "notifications" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "deleted_at" datetime NULL, "is_archived" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "notification_preferences" ("id" integer NOT NULL PRIMARY KEY , "email_enabled" bool NOT NULL, "email_file_upload" bool NOT NULL, "email_announcement" bool NOT NULL, "email_assignment" bool NOT NULL, "email_exam" bool NOT NULL, "email_grade" bool NOT NULL, "email_system" bool NOT NULL, "updated_at" datetime NOT NULL, "user_id" bigint NOT NULL UNIQUE REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "notifications" ("id" integer NOT NULL PRIMARY KEY , "title" varchar(255) NOT NULL, "body" text NOT NULL, "notification_type" varchar(20) NOT NULL, "priority" varchar(10) NOT NULL, "created_at" datetime NOT NULL, "expires_at" datetime NULL, "is_active" bool NOT NULL, "course_id" bigint NULL REFERENCES "courses" ("id") DEFERRABLE INITIALLY DEFERRED, "sender_id" bigint NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "object_id" integer unsigned NULL CHECK ("object_id" >= 0), "is_deleted_by_sender" bool NOT NULL, "is_hidden_by_sender" bool NOT NULL, "sender_deleted_at" datetime NULL);
CREATE TABLE IF NOT EXISTS "ai_configuration" ("id" integer NOT NULL PRIMARY KEY , "chunk_size" integer unsigned NOT NULL CHECK ("chunk_size" >= 0), "chunk_overlap" integer unsigned NOT NULL CHECK ("chunk_overlap" >= 0), "max_output_tokens" integer unsigned NOT NULL CHECK ("max_output_tokens" >= 0), "temperature" real NOT NULL, "user_rate_limit_per_hour" integer unsigned NOT NULL CHECK ("user_rate_limit_per_hour" >= 0), "is_service_enabled" bool NOT NULL, "maintenance_message" varchar(500) NOT NULL, "updated_at" datetime NOT NULL, "updated_by_id" bigint NULL REFERENCES "users" ("id") DEFERRABLE INITIALLY DEFERRED, "active_model" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "ai_api_keys" ("id" integer NOT NULL PRIMARY KEY , "label" varchar(100) NOT NULL, "encrypted_key" text NOT NULL, "key_hint" varchar(20) NOT NULL, "status" varchar(20) NOT NULL, "is_active" bool NOT NULL, "error_count" integer unsigned NOT NULL CHECK ("error_count" >= 0), "total_requests" integer unsigned NOT NULL CHECK ("total_requests" >= 0), "last_error" text NULL, "last_error_at" datetime NULL, "last_success_at" datetime NULL, "last_latency_ms" integer unsigned NOT NULL CHECK ("last_latency_ms" >= 0), "rpm_limit" integer unsigned NOT NULL CHECK ("rpm_limit" >= 0), "cooldown_until" datetime NULL, "tokens_used_today" integer unsigned NOT NULL CHECK ("tokens_used_today" >= 0), "tokens_reset_date" date NULL, "priority" integer unsigned NOT NULL CHECK ("priority" >= 0), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "provider" varchar(20) NOT NULL);
